@st.cache_resource
def load_faq():
    df = pd.read_excel("UP_Wiki.xlsx")

    documents = []
    for _, row in df.iterrows():
        title = str(row.get('Title', '')).strip()
        content = str(row.get('Content', '')).strip()
        if content:
            documents.append(Document(page_content=content, metadata={"title": title}))

    embeddings = OpenAIEmbeddings(model="text-embedding-3-large")
    db = FAISS.from_documents(documents, embeddings)
    return db

@st.cache_resource
def get_qa_chain():
    db = load_faq()
    retriever = db.as_retriever(search_kwargs={"k": 3})
    llm = ChatOpenAI(model_name="gpt-3.5-turbo", temperature=0)
    prompt = PromptTemplate.from_template(text["prompt"])
    return RetrievalQA.from_chain_type(
        llm=llm,
        retriever=retriever,
        chain_type="stuff",
        chain_type_kwargs={"prompt": prompt}
    )

retriever = load_faq().as_retriever(search_kwargs={"k": 5})
qa_chain = get_qa_chain()

query = st.text_input(text["input_label"], placeholder=text["input_placeholder"])

if query:
    with st.spinner(text["spinner"]):
        if simplify:
            answer = qa_chain.run(query)
            st.success(text["response_title"])
            st.markdown(answer)
        else:
            docs = retriever.get_relevant_documents(query)
            if docs:
                st.success(text["response_title"])
                for i, doc in enumerate(docs, start=1):
                    title = doc.metadata.get("title", "")
                    st.markdown(f"### {i}. {title}")
                    st.markdown(doc.page_content)
            else:
                st.warning("" if lang == "zh" else "No relevant content found.")
